import Item from "./Item";

export default function ItemList({productos}) {
    console.log(productos);
    return (
        <div className="containerItems gap-5">
            {
                productos.map((el) => {
                    return (
                        <Item key={el.id} id={el.id} image={el.image} myName={el.name}/>
                    )
                })
            }
        </div>
    )
}
